import React from "react";
import { Link } from "react-router-dom";
import "./LandingPage.css"


export default function LandingPage() {

  return (
    <div>
    <div class="background">
      <div class="title" >
        <h2>Welcome!</h2>
        <Link to="/home">
          <button type="submit">START</button>
        </Link>
        
      </div>
      
    </div>
    <div class="gon">
    <span>developed</span>
    </div>
    </div>
  );
}
